notes:
Come together with other adults to connect on a variety of topics of interest, build knowledge, share your skills and plan projects together or simply enjoy a casual conversation with your neighbours.&nbsp; Tea and coffee will be ready!&nbsp;

Free!&nbsp; Drop in!&nbsp;&nbsp;

For more information please contact: Silvia Ross, Community Social Worker at silvia.ross@calgary.ca or text 403-540-0160

Accessibility barriers:&nbsp; Multiple staircases to access program space.&nbsp; Street parking only.
